		fetch('https://jsonplaceholder.typicode.com/posts')
		.then(response=> response.json())
		.then(console.log)
	}
	return(
		<div>
			<article className=" shadow-5 br2 ba dark-gray b--black-10 mv4 w-100 w-50-m w-100-l mw10 center">
				  <img src="http://placekitten.com/g/600/300" className="db w-100 br2 br--top" alt=""/>
				  <div className="pa2 ph3-ns pb3-ns">
				    <div className="dt w-100 mt1">
				      <div className="dtc">
				        <h1 className="f5 mv0">Cat</h1>
				      </div>
				      <div className="dtc tr">
				        <h2 className="f5 mv0">$1,000</h2>
				      </div>
				    </div>
				    {<p className="f6 lh-copy measure mt2 mid-gray">
				      If it fits, i sits burrow under covers. Destroy couch leave hair everywhere,
				      and touch water with paw then recoil in horror.
				    </p>}
				  </div>
				<div className= ' pb2 mb2 tc grow pointer b--black-10'>
					<span>Reserve</span>
				</div>
			</article>

		</div>
	)

}
export default PostCardList;
